const expect = require("chai").expect;
const HomePage = require("../pageobjects/home.page");
const commontestUser = process.env.CTESTUSER;
const password = process.env.PASS;
require("dotenv").config({
  path: "./.env"
});
describe("Home Page Tests - ", async function () {
  it("1 - Should allow access with correct creds", async function () {
    await HomePage.open();
    await HomePage.username.setValue(commontestUser);
    await HomePage.password.setValue(password);
    await HomePage.submit();
    await HomePage.searchInputBox.waitForDisplayed();
    expect(await HomePage.searchText).to.be.equal("Enter MRN, de-identified id, DMP patient or sample id, or pathology or radiology accession number");
  });
  it("2 - Should not allow access with incorrect creds", async function () {
    await HomePage.open();
    await HomePage.username.setValue("test" + Math.random());
    await HomePage.password.setValue("super!");
    await HomePage.submit();
    await HomePage.wronguserpass.waitForDisplayed();
    expect(await HomePage.wronguserpass.isDisplayed()).to.be.true;
  });
  it("3 - Should display error text if username and password is blank", async function () {
    await HomePage.open();
    await HomePage.username.setValue("");
    await HomePage.password.setValue("");
    await HomePage.submit();
    await HomePage.blankuserpass.waitForDisplayed();
    expect(await HomePage.blankuserpass.isDisplayed()).to.be.true;
  });
  it("4 - Should display error text if username is typed and password is blank", async function () {
    await HomePage.open();
    await HomePage.username.setValue("test" + Math.random());
    await HomePage.password.setValue("");
    await HomePage.submit();
    await HomePage.blankuserpass.waitForDisplayed();
    expect(await HomePage.blankuserpass.isDisplayed()).to.be.true;
  });
  it("5 - Should display error text if username is blank and password is typed", async function () {
    await HomePage.open();
    await HomePage.username.setValue("");
    await HomePage.password.setValue("test" + Math.random());
    await HomePage.submit();
    await HomePage.blankuserpass.waitForDisplayed();
    expect(await HomePage.blankuserpass.isDisplayed()).to.be.true;
  });
});
//# sourceMappingURL=data:application/json;charset=utf-8;base64,

