const HomePage = require("../pageobjects/home.page");
var Diagnosis = require('../pageobjects/diagnosis.page');
var SearchPage = require('../pageobjects/search.page');
var PatientSidebarTabs = require('../pageobjects/patientsidebar.tabs');
const commontestUser = process.env.CTESTUSER;
const password = process.env.PASS;
describe('Diagnosis Page Tests :', function () {
  this.retries(0);
  it('TC20085:Verify the following labels are visible date, seer category, diagnosis, staging', async function () {
    await HomePage.open();
    await HomePage.username.setValue(commontestUser);
    await HomePage.password.setValue(password);
    await HomePage.submit();
    await HomePage.searchInputBox.waitForDisplayed();
    await SearchPage.searchForMRN();
    await SearchPage.sidebar.waitForDisplayed();
    await PatientSidebarTabs.sidebar_cancerdxtab.click();
    await Diagnosis.date.waitForDisplayed();
    expect(await Diagnosis.date.isDisplayed()).to.be.equal(true);
    expect(await Diagnosis.seercategory.isDisplayed()).to.be.equal(true);
    expect(await Diagnosis.Diagnosis.isDisplayed()).to.be.equal(true);
    expect(await Diagnosis.staging.isDisplayed()).to.be.equal(true);
  });
  it('TC20086:Verify sort by date', async function () {
    await PatientSidebarTabs.sidebar_cancerdxtab.click();
    var newer_entries = await Diagnosis.recentdate;
    var older_entry = await Diagnosis.lessrecentdate;
    expect(newer_entries).to.be.greaterThan(older_entry);
    newer_entries = Diagnosis.olddate;
    older_entry = Diagnosis.oldestdate;
    expect(older_entry).to.be.lessThan(newer_entries);
  });
});
