var Phi = require("../phi");
var EmailTemplate = require("../pageobjects/emailtemplate.page");
var commontestUser = process.env.CTESTUSER.toLowerCase();
const password = process.env.PASS;
describe("Patient Info Page Tests  - ", function () {
  this.retries(2);
  it("TC20134:Verify following fields are displayed on Patients Tab header  - Patient Name, Age, Sex, Date of Birth, Deceased Date", async function () {
    await HomePage.open();
    await HomePage.username.setValue(commontestUser);
    await HomePage.password.setValue(password);
    await HomePage.submit();
    await HomePage.searchInputBox.waitForDisplayed();
    await SearchPage.searchForMRN();
    await PatientInfoHeader.age_label.waitForDisplayed();
    expect(await PatientInfoHeader.age_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoHeader.sex_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoHeader.dateofbirth_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoHeader.deceaseddate_label.isDisplayed()).to.be.equal(true);
  });
  it("TC20135:Verify following fields are displayed on Patients Tab body - Gender, Date of Birth, MRN Create date, race, Ethnicity, Martial Status, Religion, Height, Weight, BSA, BMI, Initial Cancer Category, Do Not Mail Indicator, Last Contact, Last Activity, Last Contact, Last Hosp Adm, Last Attended Appt, Last Dr Appt, Last Treatment, Last Surgery, Last Chemo, Last Rad Onc", async function () {
    await HomePage.open();
    await HomePage.username.setValue(commontestUser);
    await HomePage.password.setValue(password);
    await HomePage.submit();
    await HomePage.searchInputBox.waitForDisplayed();
    await SearchPage.searchForMRN();
    await PatientInfoPage.gender_label.waitForDisplayed();
    expect(await PatientInfoPage.gender_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.dateofbirthdt_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.mrncreatedate_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.race_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.ethnicity_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.maritalstatus_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.religion_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.height_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.weight_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.bsa_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.bmi_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.initialcancercategory_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.donotmailindicator_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.lastcontact_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.lastactivity_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.lasthospadm_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.lastattendedappt_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.lastdrappt_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.lasttreatment_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.lastsurgery_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.lastchemo_label.isDisplayed()).to.be.equal(true);
    expect(await PatientInfoPage.lastradonc_label.isDisplayed()).to.be.equal(true);
  });
  it("TC20136:Date Field Verification - Ensure Date of Birth, Deceased Date, MRN Create Date,Last Contact, Last Activity, Last Contact, Last Hosp Adm, Last Attended Appt, " + "Last Dr Appt, Last Treatment, Last Surgery, Last Chemo, " + "Last Rad Onc complies with MON DD, YYYY format", async function () {
    await HomePage.open();
    await HomePage.username.setValue(commontestUser);
    await HomePage.password.setValue(password);
    await HomePage.submit();
    await HomePage.searchInputBox.waitForDisplayed();
    await SearchPage.searchForMRN();
    await SearchPage.sidebar.waitForDisplayed();
    expect(PatientInfoPage.isValidDate(Phi.dateofbirthdt_value)).to.be.equal(true);
    expect(PatientInfoPage.isValidDate(Phi.mrncreatedate_value)).to.be.equal(true);
    expect(PatientInfoPage.isValidDate(Phi.lastcontact_value)).to.be.equal(true);
    expect(PatientInfoPage.isValidDate(Phi.lastactivity_value)).to.be.equal(true);
    expect(PatientInfoPage.isValidDate(Phi.lasthospadm_value)).to.be.equal(true);
    expect(PatientInfoPage.isValidDate(Phi.lastattendedappt_value)).to.be.equal(true);
