    expect(PatientInfoPage.isValidDate(Phi.lasttreatment_value)).to.be.equal(true);
    expect(PatientInfoPage.isValidDate(Phi.lastsurgery_value)).to.be.equal(true);
    expect(PatientInfoPage.isValidDate(Phi.lastchemo_value)).to.be.equal(true);
    expect(PatientInfoPage.isValidDate(Phi.lastradonc_value)).to.be.equal(true);
  });

    it("TC20137:Verify all default side bar tabs are visible", async function () {
