      PatientSidebarTabs.sidebar_cancerdxtab.click();
      expect(await PatientSidebarTabs.sidebar_cancerdxtab.selector, "border-top-color").to.exist;
      PatientSidebarTabs.sidebar_pathologytab.click();
      expect(await PatientSidebarTabs.sidebar_pathologytab.selector, "border-top-color").to.exist;
      PatientSidebarTabs.sidebar_radiologytab.click();
      expect(await PatientSidebarTabs.sidebar_radiologytab.selector, "border-top-color").to.exist;
      PatientSidebarTabs.sidebar_labstab.click();
      expect(await PatientSidebarTabs.sidebar_labstab.selector, "border-top-color").to.exist;
      PatientSidebarTabs.sidebar_medicationstab.click();
      expect(await PatientSidebarTabs.sidebar_medicationstab.selector, "border-top-color").to.exist;
      PatientSidebarTabs.sidebar_surgeriestab.click();
      expect(await PatientSidebarTabs.sidebar_surgeriestab.selector, "border-top-color").to.exist;
      PatientSidebarTabs.sidebar_irtab.click();
      expect(await PatientSidebarTabs.sidebar_irtab.selector, "border-top-color").to.exist;
      PatientSidebarTabs.sidebar_rttab.click();
      expect(await PatientSidebarTabs.sidebar_rttab.selector, "border-top-color").to.exist;
      PatientSidebarTabs.sidebar_allergiestab.click();
      expect(await PatientSidebarTabs.sidebar_allergiestab.selector, "border-top-color").to.exist;
      PatientSidebarTabs.sidebar_physicianstab.click();
      expect(await PatientSidebarTabs.sidebar_physicianstab.selector, "border-top-color").to.exist;
      PatientSidebarTabs.sidebar_protocoltab.click();
      expect(await PatientSidebarTabs.sidebar_protocoltab.selector, "border-top-color").to.exist;
      PatientSidebarTabs.sidebar_pfstab.click();
      expect(await PatientSidebarTabs.sidebar_pfstab.selector, "border-top-color").to.exist;
    });

  it("TC20139:Verify parent tabs - Darwin, Search, Groups and Cohorts are visible and active from patient info tab", async function () {
    await HomePage.open();
    await HomePage.username.setValue(commontestUser);
    await HomePage.password.setValue(password);
    await HomePage.submit();
    await HomePage.searchInputBox.waitForDisplayed();
    await SearchPage.searchForMRN();
    await PatientInfoPage.darwiniconsvg.waitForDisplayed();
    expect(await PatientInfoPage.darwiniconsvg.isDisplayed()).to.equal(true);
    expect(await PatientInfoPage.searchiconsvg.isDisplayed()).to.equal(true);
    expect(await PatientInfoPage.cohortsiconsvg.isDisplayed()).to.equal(true);
  });

  it("TC20140:Verify patient info data - weight cm and height lbs", async function () {
    await HomePage.open();
    await HomePage.username.setValue(commontestUser);
    await HomePage.password.setValue(password);
    await HomePage.submit();
    await HomePage.searchInputBox.waitForDisplayed();
    await SearchPage.searchForMRN();
    expect(Phi.height_value).to.be.equal("160.5cm / 62.6in");
    expect(Phi.weight_value).to.be.equal("61.3kg / 134.9lbs");
  });

  it("TC20141:Verify email functionality from patient info header", async function () {
    await HomePage.open();
    await HomePage.username.setValue(commontestUser);
    await HomePage.password.setValue(password);
    await HomePage.submit();
    await HomePage.searchInputBox.waitForDisplayed();
    await SearchPage.searchForMRN();
    await PatientInfoHeader.mailicon.click();
    const emailheadercc = EmailTemplate.emailheadercc(commontestUser);
    expect(await emailheadercc.isDisplayed()).to.equal(true);
    expect(await EmailTemplate.to.isDisplayed()).to.equal(true);
    expect(await EmailTemplate.cc.isDisplayed()).to.equal(true);
    expect(await EmailTemplate.subject.isDisplayed()).to.equal(true);
    expect(await EmailTemplate.template.isDisplayed()).to.equal(true);
    expect(await EmailTemplate.scan.isDisplayed()).to.equal(true);
    expect(await EmailTemplate.pathreport.isDisplayed()).to.equal(true);
    expect(await EmailTemplate.pathreportwithimaging.isDisplayed()).to.equal(true);
    expect(await EmailTemplate.cancel_btn.isDisplayed()).to.equal(true);
    expect(await EmailTemplate.sendEmail_btn.isDisplayed()).to.equal(true);
    await EmailTemplate.toText.setValue(commontestUser + "@mskcc.org");
    await EmailTemplate.scan.click();
    await EmailTemplate.sendEmail_btn.click();
