var expect = require('chai').expect;
var HomePage = require('../pageobjects/home.page');
var SearchPage = require('../pageobjects/search.page');
var PatientSidebarTabs = require('../pageobjects/patientsidebar.tabs');
var Phi = require('../phi');
var Medications = require('../pageobjects/medications.page');
var Pathology = require('../pageobjects/pathology.page');
var commontestUser = process.env.CTESTUSER;
describe('Medications Page Tests :', async function () {
  this.retries(2);
  it('TC20110:Verify selecting a drug class removes the check from All Medications.', async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    await Medications.vinorebine.waitForDisplayed();
    await Medications.coagulation.click();
    await Medications.med_singlemed.waitForDisplayed();
    expect(await Medications.med_singlemed.isDisplayed()).to.be.equal(true);
    expect(await Medications.med_allmeds.isDisplayed()).to.be.equal(false);
  });
  it('TC20111:Verify that multiple drug classes can be selected', async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    await Medications.vinorebine.waitForDisplayed();
    await Medications.coagulation.click();
    expect(await Medications.congulationcheckbox.isDisplayed()).to.be.equal(true);
    Medications.endocrine.click();
    expect(await Medications.congulationcheckbox.isDisplayed()).to.be.equal(true);
    expect(await Medications.med_allmeds.isDisplayed()).to.be.equal(false);
  });
  it('TC20112:Verify that full drug class name displayed on hover', async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    await Medications.vinorebine.waitForDisplayed();
    await Medications.allmedications.waitForDisplayed();
    expect(await Medications.eyesearsnose.isDisplayed()).to.be.equal(true);
  });
  it('TC20113:Verify full drug class catalog', async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    await Medications.vinorebine.waitForDisplayed();
    expect(await Medications.anticoagulants.isDisplayed()).to.be.equal(true);
    expect(await Medications.cardiovascular.isDisplayed()).to.be.equal(true);
    expect(await Medications.chemo.isDisplayed()).to.be.equal(true);
    expect(await Medications.chemosupportive.isDisplayed()).to.be.equal(true);
    expect(await Medications.coagulation.isDisplayed()).to.be.equal(true);
    expect(await Medications.eyesearsnose.isDisplayed()).to.be.equal(true);
    expect(await Medications.gi.isDisplayed()).to.be.equal(true);
    expect(await Medications.gu.isDisplayed()).to.be.equal(true);
    expect(await Medications.hematology.isDisplayed()).to.be.equal(true);
    expect(await Medications.immune.isDisplayed()).to.be.equal(true);
    expect(await Medications.infectiousdisease.isDisplayed()).to.be.equal(true);
    expect(await Medications.ivelectrolytes.isDisplayed()).to.be.equal(true);
    expect(await Medications.neuro.isDisplayed()).to.be.equal(true);
    expect(await Medications.nutrition.isDisplayed()).to.be.equal(true);
    expect(await Medications.other.isDisplayed()).to.be.equal(true);
    expect(await Medications.pain.isDisplayed()).to.be.equal(true);
    expect(await Medications.pulmonary.isDisplayed()).to.be.equal(true);
    expect(await Medications.skincare.isDisplayed()).to.be.equal(true);
    expect(await Medications.vaccines.isDisplayed()).to.be.equal(true);
    expect(await Medications.vitamins.isDisplayed()).to.be.equal(true);
  });
  it('TC20114:Verify medications table sorted by Start date by default', async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    await Medications.vinorebine.waitForDisplayed();
    await Medications.anticoagulants.click();
    let newer_entry = await $('p=07/25/2017').getLocation();
    let older_entry = await $('p=11/17/2015').getLocation();
    expect(newer_entry.y).to.be.lessThan(older_entry.y);
    await Medications.startdate.click();
    newer_entry = await $('p=07/25/2017').getLocation();
    older_entry = await $('p=11/17/2015').getLocation();
    expect(newer_entry.y).to.be.greaterThan(older_entry.y);
  });
  it('TC20115:Verify medications table can be sorted by medication', async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    await Medications.vinorebine.waitForDisplayed();
    await Medications.endocrine.click();
    await Medications.medication.click();
    var newer_entry = await $('a=Levothyroxine Sodium').getLocation();
    var older_entry = await $('a=Fludrocortisone Acetate').getLocation();
    // default sort is newer entries appear higher in table (smaller y coordinate)
    expect(newer_entry.y).to.be.lessThan(older_entry.y);
    expect(newer_entry.y).to.be.lessThan(older_entry.y);
    // sort to descending by Medication
    await Medications.medication.click();
    newer_entry = await $('a=Levothyroxine Sodium').getLocation();
    older_entry = await $('a=Fludrocortisone Acetate').getLocation();
    expect(newer_entry.y).to.be.greaterThan(older_entry.y);
    expect(newer_entry.y).to.be.greaterThan(older_entry.y);
  });
  it('TC20116:Verify medications table has the following columns', async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    await Medications.vinorebine.waitForDisplayed();
    expect(await Medications.startdate.isDisplayed()).to.be.equal(true);
    expect(await Medications.medication.isDisplayed()).to.be.equal(true);
    expect(await Medications.basedose.isDisplayed()).to.be.equal(true);
    expect(await Medications.bsa.isDisplayed()).to.be.equal(true);
    expect(await Medications.rxdose.isDisplayed()).to.be.equal(true);
    expect(await Medications.dailydose.isDisplayed()).to.be.equal(true);
    expect(await Medications.orderroute.isDisplayed()).to.be.equal(true);
    expect(await Medications.infuseover.isDisplayed()).to.be.equal(true);
  });
  it('TC20117:Verify med admin pane opens upon clicking a medication', async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    await Medications.vinorebine.waitForDisplayed();
    await Medications.d5w.click();
    expect(await Medications.medadminpaneltext.isDisplayed()).to.be.equal(true);
  });
  it('TC20118:Verify field names on med admin panel', async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    await Medications.vinorebine.waitForDisplayed();
    await Medications.endocrine.click();
    await $('a=Levothyroxine Sodium').click();
    await Medications.datetime.waitForDisplayed();
    expect(await Medications.taskname.isDisplayed()).to.be.equal(true);
    expect(await Medications.datetime.isDisplayed()).to.be.equal(true);
    expect(await Medications.taskstatus.isDisplayed()).to.be.equal(true);
    expect(await Medications.dosegiven.isDisplayed()).to.be.equal(true);
    expect(await Medications.route.isDisplayed()).to.be.equal(true);
    expect(await Medications.taskreason.isDisplayed()).to.be.equal(true);
    expect(await Medications.taskperformedby.isDisplayed()).to.be.equal(true);
  });
  it('TC20119:Verify multiple tasks are displayed for single medication', async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    await Medications.vinorebine.waitForDisplayed();
    await Medications.lorazepam.click();
    expect(await Medications.taskname_1.isDisplayed()).to.be.equal(true);
    expect(await Medications.datetime_1.isDisplayed()).to.be.equal(true);
    expect(await Medications.taskstatus_1.isDisplayed()).to.be.equal(true);
    expect(await Medications.dosegiven_1.isDisplayed()).to.be.equal(true);
    expect(await Medications.route_1.isDisplayed()).to.be.equal(true);
    expect(await Medications.taskreason_1.isDisplayed()).to.be.equal(true);
    expect(await Medications.taskperformedby_1.isDisplayed()).to.be.equal(true);
    expect(await Medications.taskname_2.isDisplayed()).to.be.equal(true);
    expect(await Medications.datetime_2.isDisplayed()).to.be.equal(true);
    expect(await Medications.taskstatus_2.isDisplayed()).to.be.equal(true);
    expect(await Medications.dosegiven_2.isDisplayed()).to.be.equal(true);
    expect(await Medications.route_2.isDisplayed()).to.be.equal(true);
    expect(await Medications.taskreason_2.isDisplayed()).to.be.equal(true);
    expect(await Medications.taskperformedby_2.isDisplayed()).to.be.equal(true);
  });
  it('TC20120:verify med admin pane should persist upon switching tabs', async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    await Medications.vinorebine.waitForDisplayed();
    await Medications.endocrine.click();
    await $('a=Levothyroxine Sodium').click();
    expect(await Medications.medadminpaneltext.isDisplayed()).to.be.equal(true);
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    expect(await Medications.medadminpaneltext.isDisplayed()).to.be.equal(true);
  });
  it('TC20121:Verify sub category persistence and sort date persistence', async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    await Medications.vinorebine.waitForDisplayed();
    await Medications.anticoagulants.click();
    await Medications.startdate.click();
    let newer_entry = await $('p=07/25/2017').getLocation();
    let older_entry = await $('p=11/17/2015').getLocation();
    expect(newer_entry.y).to.be.greaterThan(older_entry.y);
    expect(newer_entry.y).to.be.greaterThan(older_entry.y);
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    await PatientSidebarTabs.sidebar_medicationstab.click();
    await Medications.atmsk.waitForDisplayed();
    newer_entry = await $('p=07/25/2017').getLocation();
    older_entry = await $('p=11/17/2015').getLocation();
    expect(newer_entry.y).to.be.greaterThan(older_entry.y);
    expect(newer_entry.y).to.be.greaterThan(older_entry.y);
