var expect = require("chai").expect;
var HomePage = require("../pageobjects/home.page");
var SearchPage = require("../pageobjects/search.page");
var PatientSidebarTabs = require("../pageobjects/patientsidebar.tabs");
var Problems = require("../pageobjects/problems.page");

var commontestUser = process.env.CTESTUSER;
describe("Problem page tests  - ", async function () {
  this.retries(2);
  it("TC20145 - Verify following labels are displayed - status, onsetdate, closed date, problem type, problem, description, entered, entered by and closed reason", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_problemtab.click();
    await Problems.status.waitForDisplayed();
    await Problems.enteredby.waitForDisplayed();
    expect(await Problems.status.isDisplayed()).to.be.equal(true);
    expect(await Problems.onsetdate.isDisplayed()).to.be.equal(true);
    expect(await Problems.closeddate.isDisplayed()).to.be.equal(true);
    expect(await Problems.problemtype.isDisplayed()).to.be.equal(true);
    expect(await Problems.problem.isDisplayed()).to.be.equal(true);
    expect(await Problems.description.isDisplayed()).to.be.equal(true);
    expect(await Problems.entered.isDisplayed()).to.be.equal(true);
    await Problems.enteredby.scrollIntoView({behavior: "instant", block: "center", inline: "center"});
    expect(await Problems.shownonactive.isDisplayed()).to.be.equal(true);
    expect(await Problems.enteredby.isDisplayed()).to.be.equal(true);
    expect(await Problems.closedreason.isDisplayed()).to.be.equal(true);
  });

  it("TC20146 - Verify problem record is displayed ", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_problemtab.click();
    await Problems.status.waitForDisplayed();
    expect(await Problems.statusactive.isDisplayed()).to.be.equal(true);
    expect(await Problems.typecodefallsrisk.isDisplayed()).to.be.equal(true);
    expect(await Problems.problempsychotropicsanticonvulsants.isDisplayed()).to.be.equal(true);
  });

  it("TC20147 - Verify inactive problem record is displayed ", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_problemtab.click();
    await Problems.status.waitForDisplayed();
    await Problems.shownonactive.click();
