var expect = require("chai").expect;
var Phi = require("../phi");
var HomePage = require("../pageobjects/home.page");
var SearchPage = require("../pageobjects/search.page");
var PatientSidebarTabs = require("../pageobjects/patientsidebar.tabs");
var PatientInfoHeader = require("../pageobjects/patientinfo.header");
var Pathology = require("../pageobjects/pathology.page");
var EmailTemplate = require("../pageobjects/emailtemplate.page");
// var UserSettings = require ('usersettings.page');
var LabsPage = require("../pageobjects/labs.page");
var commontestUser = process.env.CTESTUSER.toLowerCase();

describe("Pathology page tests  - ", async function () {
  this.retries(2);

  it("TC20122:Verify following labels are displayed in Report View - Performed Date, Reports, Associated Reports.", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    expect(await Pathology.performeddate.isDisplayed()).to.be.equal(true);
    expect(await Pathology.reports.isDisplayed()).to.be.equal(true);
    expect(await Pathology.associatedreports.isDisplayed()).to.be.equal(true);
  });

  it("TC20123:Verify following labels are displayed in Tissue View - Procedure Date, Tissue, Rad, Surg Path, Cyto Path, Cyto Genetics, Diag Molecular, Add'l Path.", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    await Pathology.tissueview.click();
    await Pathology.tissue.waitForDisplayed();
    expect(await Pathology.proceduredate.isDisplayed()).to.be.equal(true);
    expect(await Pathology.tissue.isDisplayed()).to.be.equal(true);
    expect(await Pathology.rad.isDisplayed()).to.be.equal(true);
    expect(await Pathology.cytopath.isDisplayed()).to.be.equal(true);
    expect(await Pathology.cytogenetics.isDisplayed()).to.be.equal(true);
    expect(await Pathology.diagmolecular.isDisplayed()).to.be.equal(true);
    expect(await Pathology.addlpath.isDisplayed()).to.be.equal(true);
  });

  it("TC20124:Verify Pathology record is displayed ", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    expect(await Pathology.performeddate_value.isDisplayed()).to.be.equal(true);
    expect(await Pathology.reports_value.isDisplayed()).to.be.equal(true);
  });

  it("TC20125:Verify report container is displayed on clicking the first report", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    await Pathology.reports_value.click();
    await Pathology.pageicon.waitForDisplayed();
    expect(await EmailTemplate.mailicon.isDisplayed()).to.be.equal(true);
  });

  it("TC20126:Verify values and text in default email template", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    await Pathology.reports_value.click();
    await Pathology.pageicon.waitForDisplayed();
    await EmailTemplate.mailicon.waitForDisplayed();
    await EmailTemplate.mailicon.click();
    await EmailTemplate.emailheader.waitForDisplayed();
    expect(await EmailTemplate.toText.isDisplayed()).to.be.equal(true);
    expect(await EmailTemplate.ccText.getValue()).to.be.equal(commontestUser + "@mskcc.org");
    expect(await EmailTemplate.subjectText.getValue()).to.be.equal("Patient " + process.env.MRN + " - " + Phi.patientname);
    expect(await Pathology.document.isDisplayed()).to.be.equal(true);
    expect(await EmailTemplate.emailBody.getValue()).to.be.equal("I'm writing you about patient " + process.env.MRN + " - " + Phi.patientname);
  });

  it("TC20127:Verify values and text in scan,path report and path report with concordant with imaging email template", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    await Pathology.reports_value.click();
    await Pathology.pageicon.waitForDisplayed();
    await EmailTemplate.mailicon.waitForDisplayed();
    await EmailTemplate.mailicon.click();
    await EmailTemplate.emailheader.waitForDisplayed();
    expect(await EmailTemplate.emailheader.isDisplayed()).to.be.equal(true);
    await EmailTemplate.scan.click();
    await EmailTemplate.subjectText.waitForDisplayed();
    expect(await EmailTemplate.subjectText.getValue()).to.be.equal("Radiology Notification about your patient " + Phi.patientname + " (" + process.env.MRN + ")");
    await EmailTemplate.pathreport.click();
    await EmailTemplate.subjectText.waitForDisplayed();
    expect(await EmailTemplate.subjectText.getValue()).to.be.equal("Radiology Notification about your patient " + Phi.patientname + " (" + process.env.MRN + ")");
    await EmailTemplate.pathreportwithimaging.click();
    await EmailTemplate.subjectText.waitForDisplayed();
    expect(await EmailTemplate.subjectText.getValue()).to.be.equal("Radiology Notification about your patient " + Phi.patientname + " (" + process.env.MRN + ")");
  });

  it("TC20128:Verify error on entering no email address in To", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    await Pathology.reports_value.click();
    await Pathology.pageicon.waitForDisplayed();
    await EmailTemplate.mailicon.waitForDisplayed();
    await EmailTemplate.mailicon.click();
    await EmailTemplate.emailheader.waitForDisplayed();
    expect(await EmailTemplate.emailheader.isDisplayed()).to.be.equal(true);
    await EmailTemplate.toText.click();
    await EmailTemplate.scan.click();
    await EmailTemplate.toError.waitForDisplayed();
    expect(await EmailTemplate.toError.isDisplayed()).to.be.equal(true);
    await EmailTemplate.cancel_btn.click();
  });

  it("TC20129:Verify error on entering invalid email address in cc", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    await Pathology.reports_value.click();
    await Pathology.pageicon.waitForDisplayed();
    await EmailTemplate.mailicon.waitForDisplayed();
    await EmailTemplate.mailicon.click();
    await EmailTemplate.emailheader.waitForDisplayed();
    expect(await EmailTemplate.emailheader.isDisplayed()).to.be.equal(true);
  });

  it("TC20130:Verify that a confirm send box pops up when user clicks send email.", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    await Pathology.reports_value.click();
    await Pathology.pageicon.waitForDisplayed();
    await EmailTemplate.mailicon.waitForDisplayed();
    await EmailTemplate.mailicon.click();
    await EmailTemplate.emailheader.waitForDisplayed();
    expect(await EmailTemplate.emailheader.isDisplayed()).to.be.equal(true);
    await EmailTemplate.toText.click();
    await EmailTemplate.toText.setValue(await HomePage.getUser() + "@mskcc.org");
    await EmailTemplate.scan.click();
    await EmailTemplate.sendEmail_btn.click();
    await EmailTemplate.emailheader.waitForDisplayed();
    expect(await EmailTemplate.emailheader.isDisplayed()).to.be.equal(true);
    expect(await EmailTemplate.subject.isDisplayed()).to.be.equal(true);
    expect(await EmailTemplate.back_btn.isDisplayed()).to.be.equal(true);
    expect(await EmailTemplate.confirm_btn.isDisplayed()).to.be.equal(true);
  });

  it("TC20131:Verify persistence on report/tissue view", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    await Pathology.tissueview.click();
    await Pathology.tissue.waitForDisplayed();
    expect(await Pathology.proceduredate.isDisplayed()).to.be.equal(true);
    await PatientSidebarTabs.sidebar_labstab.click();
    await LabsPage.reportview.waitForDisplayed();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.tissue.waitForDisplayed();
    expect(await Pathology.proceduredate.isDisplayed()).to.be.equal(true);
  });

  it("TC20132:Verify persistence on document", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    await Pathology.reports_value.click();
    await Pathology.pageicon.waitForDisplayed();
    expect(await EmailTemplate.mailicon.isDisplayed()).to.be.equal(true);
    await PatientSidebarTabs.sidebar_labstab.click();
    await LabsPage.reportview.waitForDisplayed();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.pageicon.waitForDisplayed();
    expect(await EmailTemplate.mailicon.isDisplayed()).to.be.equal(true);
  });

  it("TC20133:Verify date persistence", async function () {
    await HomePage.login(commontestUser);
    await SearchPage.searchForMRN();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    await Pathology.performeddate.click();
    await Pathology.firstrecord_value.waitForDisplayed();
    await PatientSidebarTabs.sidebar_labstab.click();
    await LabsPage.reportview.waitForDisplayed();
    await PatientSidebarTabs.sidebar_pathologytab.click();
    await Pathology.reportview.waitForDisplayed();
    expect(await Pathology.firstrecord_value.isDisplayed()).to.be.equal(true);
  });
});

