var Page = require('./page');
var moment = require ('moment');
require("dotenv").config();

class Allergies extends Page{
    get code() { return $('span=Code'); }
    get text() { return $('span=Source: Data via IDB'); }
    get type() { return $('span=Type'); }
    get notes() { return $('span=Notes'); }
    get camphortopical() { return ('div=Camphor topical'); }
    get ciprofloxacin() { return ('div=Ciprofloxacin'); }
    get drug() { return $('div=Drug'); }
    get cellElements() {
        return $$('.cDGv907QgOH-SuX6oHqMs._2ctSLtFskInorOSN0a-732');
      }

    async getCellTextAtIndex(index) {
        const cell = this.cellElements[index];
        return cell.getText();
      }
};

module.exports = new Allergies();

