var expect = require("chai").expect;
var HomePage = require("../pageobjects/home.page");
var SearchPage = require("../pageobjects/search.page");
var PatientInfoHeader = require("../pageobjects/patientinfo.header");
var PatientSidebarTabs = require("../pageobjects/patientsidebar.tabs");
var PhysiciansPage = require("../pageobjects/physicians.page");
var Phi = require("../phi");
var EmailTemplate = require("../pageobjects/emailtemplate.page");
var commontestUser = process.env.CTESTUSER.toLowerCase();
describe("Physicians Page Tests  - ", function () {
  // this.retries(2);

  it("1 - Verify following labels are visible - Role, Provider, Phone, Effective, Entered date, Org Unit, speciality", function () {
    HomePage.login(commontestUser);
    SearchPage.searchForMRN();
    PatientSidebarTabs.sidebar_physicianstab.click();
    browser.waitForVisible(PhysiciansPage.role_label);
    expect(browser.isVisible(PhysiciansPage.role_label)).to.be.equal(true);
    expect(browser.isVisible(PhysiciansPage.provider_label)).to.be.equal(true);
    expect(browser.isVisible(PhysiciansPage.phone_label)).to.be.equal(true);
    expect(browser.isVisible(PhysiciansPage.effective_label)).to.be.equal(true);
    expect(browser.isVisible(PhysiciansPage.entereddate_label)).to.be.equal(true);
    expect(browser.isVisible(PhysiciansPage.effective_label)).to.be.equal(true);
    expect(browser.isVisible(PhysiciansPage.orgunit_label)).to.be.equal(true);
    expect(browser.isVisible(PhysiciansPage.specialty_label)).to.be.equal(true);
  });
  it("2 - Verify physicians data", function () {
    HomePage.login(commontestUser);
    SearchPage.searchForMRN();
    PatientSidebarTabs.sidebar_physicianstab.click();
    browser.waitForVisible(PhysiciansPage.role_label);
    expect(browser.getAttribute(Phi.provider_value, "textContent")).to.be.equal("Riaz, Nadeem (MD)");
    expect(browser.isVisible(Phi.date_entries_01_04_2018)).to.eql([true, true, true]);
  });
  it.skip("Verify sortable by Effective Date", function () {
    HomePage.login(commontestUser);
    SearchPage.searchForMRN(Phi.getEMRfilenetMRN());
    PatientSidebarTabs.sidebar_physicianstab.click();
    browser.waitForVisible(PhysiciansPage.role_label);
    var newer_entries = browser.getLocation(Phi.emr_mrn_entries_12_26_2018);
    var older_entry = browser.getLocation(Phi.emr_mrn_entry_11_30_2018);

    // default sort is newer entries appear higher in table (smaller y coordinate)
    expect(newer_entries[0].y).to.be.lessThan(older_entry.y);
    expect(newer_entries[1].y).to.be.lessThan(older_entry.y);

    // sort to descending by effective date, pause to take effect
    browser.click($(PhysiciansPage.effective_label).selector);
    browser.pause(1000);
    newer_entries = browser.getLocation(Phi.emr_mrn_entries_12_26_2018);
    older_entry = browser.getLocation(Phi.emr_mrn_entry_11_30_2018);
    expect(newer_entries[0].y).to.be.greaterThan(older_entry.y);
    expect(newer_entries[1].y).to.be.greaterThan(older_entry.y);

    // resort to ascending again by effective date, pause to take effect
    browser.click($(PhysiciansPage.effective_label).selector);
    browser.pause(1000);
    newer_entries = browser.getLocation(Phi.emr_mrn_entries_12_26_2018);
    older_entry = browser.getLocation(Phi.emr_mrn_entry_11_30_2018);
    expect(newer_entries[0].y).to.be.lessThan(older_entry.y);
    expect(newer_entries[1].y).to.be.lessThan(older_entry.y);
  });
  it("3 - Check that clicking on the provider name email opens the email box", function () {
    HomePage.login(commontestUser);
    SearchPage.searchForMRN();
    PatientSidebarTabs.sidebar_physicianstab.click();
    browser.waitForVisible(PhysiciansPage.role_label);
    browser.moveToObject($(Phi.provider_value_2).selector);
    browser.waitForVisible(Phi.provider_email);
    $(Phi.provider_email).click();
    browser.waitForVisible(EmailTemplate.emailheader);
    expect(browser.isVisible(EmailTemplate.emailheader)).to.be.equal(true);
    expect(browser.isVisible(EmailTemplate.emailheadercc(commontestUser))).to.be.equal(true);
    expect(browser.getAttribute(EmailTemplate.toText, "value")[0]).to.be.equal("girotram@mskcc.org");
    expect(browser.getAttribute(EmailTemplate.ccText, "value")).to.be.equal(commontestUser + "@mskcc.org");
    expect(browser.getAttribute(EmailTemplate.subjectText, "value")).to.be.equal("Patient " + process.env.MRN + " - " + Phi.patientnamevalue.getText());
    expect(browser.isVisible(EmailTemplate.template)).to.be.equal(true);
    expect(browser.isVisible(EmailTemplate.scan)).to.be.equal(true);
