const page = require("../pageobjects/page");
const rp = require("request-promise");

const COHORT_ID_DAVINCITEST3 = 250;
const COHORT_ID_DAVINCITEST4 = 602;

const api = {
  global_token: "",
  cohort_id: "",
  DDP_API_URL: "",
  DDP_LOGIN_URL: "",
  DDP_COHORT_URL: "",
  DDP_RECOMMENDATIONS_URL: "",
  DDP_DELETE_PROTOCOL: "",
  DDP_RESET_SETTINGS: "",
  DDP_COHORTS_ACTIVESTATUS: "",
  DDP_COHORTS_ADDPATIENT: "",
  DDP_COHORTS_NOTIFICATIONS: "",

  async getTokenMain(user) {
    console.log("in get token main " + user);
    this.LDAP_USERNAME = user;

    if (process.env.ENV_VAR === "local") {
      this.DDP_API_URL = "http://localhost:5000/api";
    } else if (process.argv[2].includes("staging") || process.argv[2].includes("wdio.conf.js")) {
      this.DDP_API_URL = "https://staging-ddp.mskcc.org/api";
    } else if (process.argv[2].includes("dev")) {
      this.DDP_API_URL = "https://dev-ddp.mskcc.org/api";
    } else if (process.argv[2].includes("pr.")) {
      this.DDP_API_URL = "https://tlvdpddp3.mskcc.org/api";
    } else if (process.argv[2].includes("prod")) {
      this.DDP_API_URL = "https://ddp.mskcc.org/api";
    } else if (process.argv[2].includes("qa")) {
      this.DDP_API_URL = "https://qa-ddp.mskcc.org/api";
    } else {
    console.log("Error parsing environment");
    }

    if (user == "davincitest3") {
      this.cohort_id = COHORT_ID_DAVINCITEST3;
    } else if (user == "davincitest4") {
      this.cohort_id = COHORT_ID_DAVINCITEST4;
    }

    this.DDP_LOGIN_URL = this.DDP_API_URL + "/v1/authenticate/token";
    this.DDP_COHORT_URL = this.DDP_API_URL + "/v1/cohorts/";
    this.DDP_RECOMMENDATIONS_URL = DDP_API_URL + "/v2/patient/protocol_recommendations/";
    this.DDP_DELETE_PROTOCOL = DDP_API_URL + "/v1/user/settings/protocol";
    this.DDP_RESET_SETTINGS = DDP_API_URL + "/v1/user/settings/";
    this.DDP_COHORTS_ACTIVESTATUS = DDP_API_URL + "/v1/cohorts/" + api.cohort_id + "/patients/active_status/";
    this.DDP_COHORTS_ADDPATIENT = DDP_API_URL + "/v1/patient/cohorts/add/";
    this.DDP_COHORTS_NOTIFICATIONS = DDP_API_URL + "/v1/cohorts/" + api.cohort_id + "/patients/notifications/";

    await this.getToken();

    browser.pause();
  },

  async getToken() {
    try {
      const options = {
        method: "POST",
        uri: this.DDP_LOGIN_URL,
        body: {
          username: this.LDAP_USERNAME,
          password: process.env.PASS,
        },
        json: true,
      };

      const response = await rp(options);
      if (response && response.auth_token) {
        this.global_token = response.auth_token;
      }
    } catch (error) {
      console.error(error);
    }
  },
};

module.exports = api;

