      PatientSidebarTabs.sidebar_radiologytab.click();
      expect(browser.getCssProperty(PatientSidebarTabs.sidebar_radiologytab.selector, "border-top-color").parsed.hex).to.be.equal("#ffffff");
      PatientSidebarTabs.sidebar_labstab.click();
      expect(browser.getCssProperty(PatientSidebarTabs.sidebar_labstab.selector, "border-top-color").parsed.hex).to.be.equal("#ffffff");
      PatientSidebarTabs.sidebar_medicationstab.click();
      expect(browser.getCssProperty(PatientSidebarTabs.sidebar_medicationstab.selector, "border-top-color").parsed.hex).to.be.equal("#ffffff");
