      PatientSidebarTabs.sidebar_rttab.click();
      expect(browser.getCssProperty(PatientSidebarTabs.sidebar_rttab.selector, "border-top-color").parsed.hex).to.be.equal("#ffffff");
      PatientSidebarTabs.sidebar_allergiestab.click();
      expect(browser.getCssProperty(PatientSidebarTabs.sidebar_allergiestab.selector, "border-top-color").parsed.hex).to.be.equal("#ffffff");
